import {View, Text, Image, StyleSheet} from 'react-native'

const frogItem = props =>{
    var icon =require('../assets/icon.png');
    console.log(props)
    if(props.image == typeof('String')){
        icon = require(props.image);
    }
    return(
        <View style={styles.frogs}>
            <Image source={icon} style={styles.frogs} />        
            <Text>{props.name}</Text>
        </View>
    )
}

const styles = StyleSheet.create({
    frogs:{
        width: "100%"
    }
})

export default frogItem;
